/* eslint-disable */

import { useEffect, useState } from 'react';

// material-ui
import { Grid } from '@mui/material';
import GridForm from './GridForm.js.js.js.js';
// project imports
import EarningCard from '../company/EarningCard';
import PopularCard from '../company/PopularCard';
import TotalOrderLineChartCard from '../company/TotalOrderLineChartCard';
import TotalIncomeDarkCard from '../company/TotalIncomeDarkCard';
import TotalIncomeLightCard from '../company/TotalIncomeLightCard';
import TotalGrowthBarChart from '../company/TotalGrowthBarChart';
import { gridSpacing } from 'store/constant';

// ==============================|| DEFAULT DASHBOARD ||============================== //

const TFGInfo = () => {
    const [isLoading, setLoading] = useState(true);
    useEffect(() => {
        setLoading(false);
    }, []);

    return (
        // dos filas
        <Grid container spacing={gridSpacing}>
            {/* fila 1 */}
            <Grid item xs={12}>
                {/* 3 columnas */}
                <Grid container spacing={gridSpacing}>
                    {/* columna 1 */}
                    <Grid item lg={8} md={6} sm={6} xs={12}>
                        <TotalOrderLineChartCard isLoading={isLoading} />
                    </Grid>

                </Grid>
            </Grid>
            {/* fila 2 */}
            <Grid item xs={12}>
                 {/* 2 columnas */}
                <Grid container spacing={gridSpacing}>
                    {/* columna 1 */}
                    <Grid item xs={12} md={8}>
                        <GridForm />
                    </Grid>

                </Grid>
            </Grid>
        </Grid>
    );
};

export default TFGInfo;
